  state = {
   pokemon: "pikachu",
   user: "Margaux",
   city: "Paris"
  }

   render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1> Notre super POKEDEX version OCRES </h1>        
        </header>
        <input
          type="text"
          name="Pokemon"
          value={city}
        />
      </div>
    );
   }
    
}

export default App;
